import React from 'react';

function ModalWindow(props) {
    function createModalWindow(){
        return props.words.map(item => {
            return <p>{item.word}</p>
        })
    };
    return (
        <div>
            {createModalWindow()}
        </div>
    );
}

export default ModalWindow;
